const Centres = () => {
  return (
    <main className="App-home">
      <Container>
        <Row className="py-4 my-4">
          {/* <div>Cafe page - coming soon</div> */}
          <p>
            A Pokémon Center is an official Pokémon shop where you can purchase
            Pokemon products and Centre-exclusive items.
          </p>
          <p>
            <Badge bg="primary">Info Coming Soon!</Badge>
          </p>
        </Row>
      </Container>
    </main>
  );
};

export default Centres;
